import logo from './logo.svg';
//import './App.css';
import EvCard from './EventsList';


class EventsList extends Component {

    constructor(props){
        super(props);
        this.state = {
            
        };
       
    }


  render() {
    var eventsArray = {
        "name":"running",
        "description":"long run",
        "evPic":"null",
        "howFar":"5",
        "attending":"6",
        "required":"3"
        };
        
      // var obj=JSON.parse(eventsArray);
       console.log(eventsArray.name);
       // <th><EvCard name={eventsArray[0].name} description={eventsArray[0].description} howFar={eventsArray[0].howFar}  attending={eventsArray[0].attending}/></th>
    return (
        <div>
        <table>
            <tbody>
        <tr>
        <th>Lastname</th> 
          <th>Lastname</th> 
          <th>Age</th>
        </tr>
        <tr>
          <td>Jill</td>
          <td>Smith</td> 
          <td>50</td>
        </tr>
        <tr>
          <td>Eve</td>
          <td>Jackson</td> 
          <td>94</td>
        </tr>
        </tbody>
      </table>
      </div>
    );
  }
}

export default EventsList;
